query NewsfeedQuery {
  topStory {
    ...StoryFragment
    id
  }
}

fragment StoryFragment on Story {
  title
  summary
  createdAt
  poster {
    __typename
    name
    profilePicture {
      url
    }
    ... on Node {
      __isNode: __typename
      id
    }
  }
  thumbnail {
    url
  }
}
